# La lista de de triples se homogeneiza mediante la función homo_triples. Esta función asigna etiqueta 0 cuando uno de los anotadores tiene una etiqueta en una posición en la que el otro anotador no tiene nada. Esto es un requerimiento de la librería agreement de NLTK
